#include "utility.h"

// 493. Reverse Pairs https://leetcode.com/problems/reverse-pairs/#/description
// Given an array nums, we call (i, j) an important reverse pair if i < j and nums[i] > 2*nums[j].
// You need to return the number of important reverse pairs in the given array.
// Example1:
// Input: [1,3,2,3,1]
// Output: 2
// Example2:
// Input: [2,4,3,5,1]
// Output: 3
// Note:
//     The length of the given array will not exceed 50,000.
//     All the numbers in the input array are in the range of 32-bit integer.
    template <typename Iterator>
    int mergeAndCountReversePairs(Iterator first, Iterator mid, Iterator last, Iterator buf) {
        if (first == mid || mid == last) return 0;
        // assert(is_sorted(first, mid));
        // assert(is_sorted(mid, last));
        int res = 0, cnt = mid - first;
        for (auto left = mid - 1, left_end = first - 1, right = last - 1; left != left_end && *left / 2 + (*left % 2 > 0) > *mid; --left) {
            for (; !(*left / 2 + (*left % 2 == 1) > *right); --right) {}
            res += right - mid + 1;
        }
        // merge
        std::move(first, mid, buf);
        for (; cnt > 0 && mid != last; ++first) {
            if (*mid < *buf) { *first = *mid, ++mid; }
            else { *first = *buf, ++buf, --cnt; }
        }
        std::move(buf, buf + cnt, first);
        return res;
    }
    template <typename Iterator>
    int sortAndCountReversePairs(Iterator first, Iterator last, Iterator buf) {
        if (first == last || first + 1 == last) return 0;
        auto mid = first + (last - first) / 2;
        int res = sortAndCountReversePairs(first, mid, buf) + sortAndCountReversePairs(mid, last, buf);
        return res + mergeAndCountReversePairs(first, mid, last, buf);
    }
    int reversePairs(vector<int>& nums) {
        std::vector<int> buffer ((1 + nums.size()) / 2);
        auto first = nums.begin(), last = nums.end();
        return sortAndCountReversePairs(first, last, buffer.begin());
    }

