// 315. Count of Smaller Numbers After Self  https://leetcode.com/problems/count-of-smaller-numbers-after-self/#/description
// You are given an integer array nums and you have to return a new counts array.
// The counts array has the property where counts[i] is the number of smaller elements to the right of nums[i].
// Example:
// Given nums = [5, 2, 6, 1]
// To the right of 5 there are 2 smaller elements (2 and 1).
// To the right of 2 there is only 1 smaller element (1).
// To the right of 6 there is 1 smaller element (1).
// To the right of 1 there is 0 smaller element.
// Return the array [2, 1, 1, 0]. 
    template <typename Iterator>
    void sortAndCountSmaller(Iterator first, Iterator last, vector<int> &counts) {
        // cout << "sz = " << last - first << endl;
        if (last - first < 2) return;
        auto mid = first + (last - first) / 2;
        sortAndCountSmaller(first, mid, counts);
        sortAndCountSmaller(mid, last, counts);
        // count then merge
        const auto guard_value = mid->second;
        --first, --mid, --last;
        auto left = mid, right = last;
        for (; left != first && left->second > guard_value; --left) {
            for (; right != mid && !(left->second > right->second); --right) {}
            counts[left->first] += right - mid;
        }
        ++first, ++mid, ++last;
        std::inplace_merge(first, mid, last, [](std::pair<size_t,int> lhs, std::pair<size_t,int> rhs) { return lhs.second < rhs.second; });
    }
    vector<int> countSmaller(vector<int>& nums) {
        vector<int> res(nums.size());
        auto e = enumerate(nums.begin(), nums.end());
        sortAndCountSmaller(e.begin(), e.end(), res);
        return res;
    }

